import React from 'react';

interface TreeProps {
    items: Item[];
}

interface Item {
    id: number;
    name: string;
    children?: Item[];
}

const Tree: React.FC<TreeProps> = ({ items }) => {
    const renderTree = (items: Item[]) => {
        return (
            <ul>
                {items.map((item) => (
                    <li key={item.id}>
                        {item.name}
                        {item.children && renderTree(item.children)}
                    </li>
                ))}
            </ul>
        );
    };

    return <div>{renderTree(items)}</div>;
};

export default Tree;
